          Activites
        </h1>
        <div className="drag" style={{ display: "flex",marginLeft:24 }}>
        {drag.map((buttontxt) => {
  return <Buttons key={buttontxt.id} id={buttontxt.id} button={buttontxt.button} />;
})}
</div>

      </div>
    </>
  );
